// Login Modal 

import { useState } from 'react'

function Login() {

    // Modal States Hide/Show
    const [toggleModal, setToggleModal] = useState(false)
    const handleClose = () => setToggleModal(false)
    const handleShow = () => setToggleModal(true)

  return (
    <>
    <dialog aria-labelledby="login-modal" aria-describedby="login-modal-email-password" onClick={handleShow} show="false" onHide={handleClose}>
        <h1>Login</h1>

    </dialog>
    </>
  )
}

export default Login
